$(document).ready(function(){$("#main-character-selection tr").on("click",function(){var n=$(this).children("td").map(function(){return $(this).text()}).get(),t=n[0],i=n[4];$.post("../manage/setmaincharacter",{name:t,realm:i}).done(function(){location.reload()})});var n=document.location.toString();n.match("#")&&$('.nav-tabs a[href="#'+n.split("#")[1]+'"]').tab("show");$(".nav-tabs a").on("shown.bs.tab",function(n){window.location.hash=n.target.hash})});